import React, { useState } from "react";
import "./MoveItems.css";
import ListItems from "../ListItems/ListItems";

function MoveItems() {
  const arrshapeDefault = [
    "circle-s",
    "square-s",
    "oval-s",
    "rectangle-s",
    "trapezoid-s",
    "palallelogram-s",
  ];

  const [arrshape, setArrshape] = useState(arrshapeDefault);

  const movePosition = (arrshapeDefault) => {
    for (let i = 0; i < 3; i++) {
      let temp = arrshapeDefault[i];

      arrshapeDefault[i] = arrshapeDefault[i + 3];
      arrshapeDefault[i + 3] = temp;
    }
    setArrshape(arrshapeDefault);
    console.log(arrshape);
  };

  return (
    <div>
      <div className="MoveItems">
        <ul className="move-items-container">
          <li className="move-items-button-container">
            <button className="move-button shape">
              <div className="left-arrow"></div>
              <p className="move-shape-b">Move shape</p>
            </button>
            <button onClick={movePosition} className="move-button position">
              <div className="up-arrow"></div>
              <div className="down-arrow"></div>
              <p className="move-position-b">Move position</p>
            </button>
            <button className="move-button shape">
              <div className="right-arrow"></div>
              <p className="move-shape-b">Move shape</p>
            </button>
          </li>
          <div className="underline"></div>
        </ul>
      </div>
      <ListItems arrshape={arrshape} />
    </div>
  );
}

export default MoveItems;
